"    <div id=\"topicTitle\">",
"     Patient information: Hemoglobin A1C tests (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/hemoglobin-a1c-tests-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H27502368\">",
"      <span class=\"h1\">",
"       What is hemoglobin A1C?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Hemoglobin A1C is a blood test that shows what your average blood sugar level has been for the past 2 to 3 months (",
"      <a class=\"graphic graphic_table graphicRef76310 \" href=\"UTD.htm?6/10/6316\">",
"       table 1",
"      </a>",
"      ). Doctors and nurses use this test for 2 reasons:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        To see whether a person has diabetes",
"       </li>",
"       <li>",
"        To see whether diabetes treatment is working the right way",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Other names for hemoglobin A1C are &ldquo;glycated hemoglobin,&rdquo; &ldquo;HbA1C,&rdquo; or just &ldquo;A1C.&rdquo;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H27502375\">",
"      <span class=\"h1\">",
"       What should my A1C numbers be?",
"      </span>",
"      &nbsp;&mdash;&nbsp;That depends on why you have the test.",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         When checking for diabetes",
"        </strong>",
"        &mdash; If you had an A1C test to see if you have diabetes, your A1C should be 6 or less.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        If your A1C is 6.5 or higher, it probably means you have diabetes, but you should have the test done again to be sure",
"       </li>",
"       <li>",
"        If your A1C is between 5.7 and 6.4, you are at risk for getting diabetes. You should probably start doing things that can help prevent diabetes. For example, you should become more active and lose weight (if you are overweight). &nbsp;",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         When checking how treatment is working",
"        </strong>",
"        &mdash; If you already know you have diabetes, and you had an A1C test to see how well controlled your blood sugar is, your A1C should probably be 7 or less. But you need to check with your doctor on what your level should be. Not everyone with diabetes is the same. Some people need to aim for different A1C levels than others.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H27502382\">",
"      <span class=\"h1\">",
"       Can I do this test at home?",
"      </span>",
"      &nbsp;&mdash;&nbsp;It is now possible to buy kits to test your A1C at home. But home testing of A1C is not usually necessary.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H27502389\">",
"      <span class=\"h1\">",
"       How often should I have an A1C test?",
"      </span>",
"      &nbsp;&mdash;&nbsp;That depends on whether you have diabetes and on what your last A1C test showed.",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        If you had an A1C test to check for diabetes and your A1C was less than 5.7 (meaning you do NOT have diabetes), you should have A1C tests done every 3 years.",
"       </li>",
"       <li>",
"        If you had an A1C test to check for diabetes and your A1C was between 5.7 and 6.4 (meaning you do not have diabetes but are at risk for it), you should have A1C tests done every year. &nbsp;",
"       </li>",
"       <li>",
"        If you do have diabetes and your blood sugar is well controlled, you should have A1C tests every 6 months.",
"       </li>",
"       <li>",
"        If you have diabetes and you recently changed treatment plans or you are having trouble controlling your blood sugar, you should have A1C tests every 3 months.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H27502396\">",
"      <span class=\"h1\">",
"       Why do my A1C numbers matter?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Studies show that keeping A1C numbers close to normal helps keep people from getting:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Diabetic retinopathy, an eye disease that can cause blindness &nbsp;",
"       </li>",
"       <li>",
"        Nerve damage caused by diabetes (also called neuropathy)",
"       </li>",
"       <li>",
"        Kidney disease",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      For people with newly diagnosed diabetes, keeping the A1C close to normal might also prevent heart attacks and strokes in the future.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H27502403\">",
"      <span class=\"h1\">",
"       Do I still need to measure my blood sugar at home?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If your doctor wants you to check your blood sugar at home, you should keep doing so even if you have routine A1C tests. Blood sugar tests tell you what your blood sugar is from moment to moment. That&rsquo;s important information to have, because it lets you know if your medications and lifestyle changes are keeping your blood sugar in a safe range.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H27502500\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
