var title_f0_14_232="Ruptured abdominal aortic aneurysm";
var content_f0_14_232=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RADIOL%2F87665&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RADIOL%2F87665&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 618px\">",
"   <div class=\"ttl\">",
"    Ruptured abdominal aortic aneurysm",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 598px; height: 508px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The CT scan of the abdomen shows an acute rupture of a 5 cm infrarenal abdominal aortic aneurysm. The high density acute blood obliterates the periaortic fat plane (arrow in A). The blood dissects into the retroperitoneum and obliterates the fat plane around the IVC (arrowhead) and the right psoas muscle in the posterior pararenal space (dashed arrow). The high density acute blood is better appreciated with narrowed windows (arrow in B). The full extent of the bleed is demonstrated by the maroon overlay in image C. The aneurysm is overlaid in bright red and the compressed IVC in blue.",
"    <div class=\"footnotes\">",
"     CT: computed tomography; AAA: abdominal aortic aneurysm; IVC: inferior vena cava.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
