var script_f0_14_237=[""].join("\n");
var outline_f0_14_237=null;
var title_f0_14_238="Rifamycin drug interactions";
var content_f0_14_238=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F57694&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F57694&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Clinically significant drug-drug interactions involving the rifamycins",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Drug class",
"       </td>",
"       <td class=\"subtitle1\">",
"        Drugs whose concentrations are substantially decreased by rifamycins",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comments",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"11\">",
"        Antiinfectives",
"       </td>",
"       <td>",
"        HIV-1 protease inhibitors (saquinavir, indinavir, nelfinavir, amprenavir, ritonavir, lopinavir/ritonavir)",
"       </td>",
"       <td>",
"        Can be used with ribabutin. Ritonavir, 400-600 mg twice-daily, probably can be used with rifampin. The combination of saquinavir and ritonavir can also be used with rifampin.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Nonnucleoside reverse transcriptase inhibitors",
"       </td>",
"       <td rowspan=\"4\">",
"        Delavirdine should not be used with any rifamycin. Doses of nevirapine and efavirenz need to be increased if given with rifampin, no dose increase needed if given with rifabutin.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Delavirdine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Nevirapine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Efavirenz",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Macrolide antibiotics (clarithromycin, erythromycin)",
"       </td>",
"       <td>",
"        Azithromycin has no significant interaction with rifamycins",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Doxycycline",
"       </td>",
"       <td>",
"        May require use of a drug other than doxycycline",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Azole antifungal agents (ketoconazole, itraconazole, voriconazole)",
"       </td>",
"       <td>",
"        Itraconazole ketoconazole, and voriconazole concentrations may be subtherapeutic with any of the rifamycins. Fluconazole can be used with rifamycins, but the dose of fluconazole may have to be increased.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Atovaquone",
"       </td>",
"       <td>",
"        Consider alternate form of",
"        <em>",
"         Pneumocystis carinii",
"        </em>",
"        treatment or prophylaxis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Chloramphenicol",
"       </td>",
"       <td>",
"        Consider an alternative antibiotic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Mefloquine",
"       </td>",
"       <td>",
"        Consider alternate form of malaria prophylaxis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        Hormone therapy",
"       </td>",
"       <td>",
"        Ethinylestradiol, norethindrone",
"       </td>",
"       <td>",
"        Women of reproductive potential on oral contraceptives should be advised to add a barrier method of contraception when taking a rifamycin",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tamoxifen",
"       </td>",
"       <td>",
"        May require alternate therapy or use of a nonrifamycin-containing regimen",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Levothyroxine",
"       </td>",
"       <td>",
"        Monitoring of serum TSH recommended; may require increased dose of levothyroxine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Narcotics",
"       </td>",
"       <td>",
"        Methadone",
"       </td>",
"       <td>",
"        Rifampin and rifapentine use may require methadone dose increase; rifabutin infrequently causes methadone withdrawal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Anticoagulants",
"       </td>",
"       <td>",
"        Warfarin",
"       </td>",
"       <td>",
"        Monitor prothrombin time; may require two- to threefold dose increase",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Immunosuppressive agents",
"       </td>",
"       <td>",
"        Cyclosporine, tacrolimus",
"       </td>",
"       <td>",
"        Rifabutin may allow concomitant use of cyclosporine and a rifamycin; monitoring of cyclosporine serum concentrations may assist with dosing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Corticosteroids",
"       </td>",
"       <td>",
"        Monitor clinically; may require two- to threefold increase in corticosteroid dose",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Anticonvulsants",
"       </td>",
"       <td>",
"        Phenytoin, lamotrigine",
"       </td>",
"       <td>",
"        Therapeutic drug monitoring recommended; may require anticonvulsant dose increase",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"6\">",
"        Cardiovascular agents",
"       </td>",
"       <td>",
"        Verapamil, nifedipine, diltiazem (a similar interaction is also predicted for felodipine and nisoldipine)",
"       </td>",
"       <td>",
"        Clinical monitoring recommended; may require change to an alternate cardiovascular agent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Propranolol, metoporol",
"       </td>",
"       <td>",
"        Clinical monitoring recommended; may require dose increase or change to an alternate cardiovascular drug",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Enalapril, losartan",
"       </td>",
"       <td>",
"        Monitor clinically; may require a dose increase or use of an alternate cardiovascular drug",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Digoxin (among patients with renal insufficiency), digitoxin",
"       </td>",
"       <td>",
"        Therapeutic drug monitoring recommended; may require digoxin or digitoxin dose increase",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Quinidine",
"       </td>",
"       <td>",
"        Therapeutic drug monitoring recommended; may require quinidine dose increase",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Mexilitine, tocainide, propafenone",
"       </td>",
"       <td>",
"        Clinical monitoring recommended; may require change to an alternate cardiovascular drug",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Bronchodilators",
"       </td>",
"       <td>",
"        Theophylline",
"       </td>",
"       <td>",
"        Therapeutic drug monitoring recommended; may require theophylline dose increase",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sulfonylurea hypoglycemics",
"       </td>",
"       <td>",
"        Tolbutamide, chlorpropamide, glyburide, glimepiride, repaglinide",
"       </td>",
"       <td>",
"        Monitor blood glucose; may require dose increase or change to an alternate hypoglycemic drug",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hypolipidemics",
"       </td>",
"       <td>",
"        Simvastatin, fluvastatin",
"       </td>",
"       <td>",
"        Monitor hypolipidemic effect; may require use of an alternate hypolipidemic drug",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        Psychotropic drugs",
"       </td>",
"       <td>",
"        Nortriptyline",
"       </td>",
"       <td>",
"        Therapeutic drug monitoring recommended; may require dose increase or change to alternate psychotropic drug",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Haloperidol, quetiapine",
"       </td>",
"       <td>",
"        Monitor clinically; may require a dose increase or use of an alternate psychotropic drug",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Benzodiazepines (eg, diazepam, triazolam), zolpidem, buspirone",
"       </td>",
"       <td>",
"        Monitor clinically; may require a dose increase or use of an alternate psychotropic drug",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Blumberg, HM, Burman, WJ, Chaisson, RE, et al. American Thoracic Society/Centers for Disease Control and Prevention/Infectious Diseases Society of America: treatment of tuberculosis. Am J Respir Crit Care Med 2003; 167:603. Official Journal of the American Thoracic Society. Copyright &copy;2003 American Thoracic Society.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
